.macro GET_TABLERO(%X, %Y)
    la $t3, cant_minas        
    move $t2, %X
    addi $t2, $t2, -1       
    add $t2, $t2, $t2    
    add $t2, $t2, $t2    
    add $t4, $t2, $t3    
    lw %Y, 0($t4)       # get
.end_macro

####################### 
#   GET_TABLERO_i_j   #
#######################
#guarda en $a0 el contenido de la celda tablero[i][j]
# i = $a0
# j = $a1
# $a0 = tablero[i][j]
.macro GET_TABLERO_i_j(%X,%Y,%Z)
    la $t3, tablero         	# cargar tablero en $t3
    move $t4, %X           	# i
    move $t2, %Y		# j
    add $t4, $t4, $t4		# i = i*2
    add $t4, $t4, $t4		# i = i*2 => (i*4)
    add $t2, $t2, $t2		# j = j*2
    add $t2, $t2, $t2		# j = j*2 => (j*4)
    mul $t4, $t4, 15		# i = i*n
    add $t4, $t4, $t2		# i = i*n + j
    add $t2, $zero, $zero
    add $t2, $t4, $t3    	# 
    lw %Z, 0($t2)       	# get+
.end_macro


#######################  
#   SET_TABLERO_i_j   #
#######################
#Seteamos la posicion tablero[i][j]
# i = $a0
# j = $a1
# tablero[i][j] = %X   %X = registro que tiene el entero a setear en la matriz
.macro SET_TABLERO_i_j(%X,%Y,%Z)
    la $t3, tablero         	# cargar tablero en $t3
    move $t4, %X           	# i
    move $t2, %Y		# j
    add $t4, $t4, $t4		# i = i*2
    add $t4, $t4, $t4		# i = i*2 => (i*4)
    add $t2, $t2, $t2		# j = j*2
    add $t2, $t2, $t2		# j = j*2 => (j*4)
    mul $t4, $t4, 15		# i = i*n
    add $t4, $t4, $t2		# i = i*n + j
    add $t2, $zero, $zero
    add $t2, $t4, $t3    	# 
    add $t4, $zero, $zero
    move $t4, %Z			# $a0 = %X
    sw $t4, 0($t2)       	# tablero[i][j] = $a0
.end_macro  


