#######################  
#  CONTADOR CDE MINAS #
#######################
# temporales que tengo para usar t0, t1, t5, t6, t8, t9
.macro contar_minas(%X)
    move $t5, %X
    addi $t8, $zero, 0
    for1:
        addi $t9, $zero, -1
        for2:
            addi $t9, $t9, 1
            GET_TABLERO_i_j($t8,$t9,$t6)
            bne $t6, -1, branch
        
            case_1:                        # caso 1: i-1; j-1  # $t0 aux_i, $t1 aux_j
                addi $t0, $t8, -1                
                addi $t1, $t9, -1                
                bltu $t0, 0, case_4        # si es menor que 0 no sirve
                bltu $t1, 0, case_2        # si es menor que 0 no sirve
                GET_TABLERO_i_j($t0,$t1,$t6)
                beq $t6, -1, case_2        # si es -1, hay una mina, entonces se salta
                addi $t6, $t6, 1           # aumentar en 1
                SET_TABLERO_i_j($t0,$t1,$t6)
                j case_2
     
            case_2:                        # caso 2: i-1; j
                addi $t0, $t8, -1                
                addi $t1, $t9, 0                
                bltu $t0, 0, case_4        # si es menor que 0 no sirve
                GET_TABLERO_i_j($t0,$t1,$t6)
                beq $t6, -1, case_3        # si es -1, hay una mina, entonces se salta
                addi $t6, $t6, 1           # aumentar en 1
                SET_TABLERO_i_j($t0,$t1,$t6)
                j case_3
            
            case_3:                        # caso 3: i-1; j+1
                addi $t0, $t8, -1                
                addi $t1, $t9, 1                
                bltu $t0, 0, case_4        # si es menor que 0 no sirve
                bgtu $t1, $t5, case_4      # si es mayor que el numero maximo de la columna
                GET_TABLERO_i_j($t0,$t1,$t6)
                beq $t6, -1, case_4
                addi $t6, $t6, 1           # aumentar en 1
                SET_TABLERO_i_j($t0,$t1,$t6)
                j case_4
            
            case_4:                        # caso 4:   i; j-1     
                addi $t0, $t8, 0          
                addi $t1, $t9, -1                
                bltu $t1, 0, case_5        # si es menor que 0 no sirve
                GET_TABLERO_i_j($t0,$t1,$t6)
                beq $t6, -1, case_5        # si es -1, hay una mina, entonces se salta
                addi $t6, $t6, 1           # aumentar en 1
                SET_TABLERO_i_j($t0,$t1,$t6)
                j case_5
                
            case_5:                        # caso 5:   i; j+1
                addi $t0, $t8, 0 
                addi $t1, $t9, 1                
                bgtu $t1, $t5, case_6      # si es mayor que el numero maximo de la columna
                GET_TABLERO_i_j($t0,$t1,$t6)
                beq $t6, -1, case_6
                addi $t6, $t6, 1           # aumentar en 1
                SET_TABLERO_i_j($t0,$t1,$t6)
                j case_6
                
            case_6:                        # caso 6: i+1; j-1
                addi $t0, $t8, 1                
                addi $t1, $t9, -1                
                bltu $t1, 0, case_7        # si es menor que 0 no sirve
                bgtu $t0, $t5, branch      # si es mayor que el numero maximo de la columna
                GET_TABLERO_i_j($t0,$t1,$t6)
                beq $t6, -1, case_7
                addi $t6, $t6, 1           # aumentar en 1
                SET_TABLERO_i_j($t0,$t1,$t6)
                j case_7
                
            case_7:                        # caso 7: i+1; j
                addi $t0, $t8, 1                
                addi $t1, $t9, 0                
                bgtu $t0, $t5, branch      # si es mayor que el numero maximo de la columna
                GET_TABLERO_i_j($t0,$t1,$t6)
                beq $t6, -1, case_8
                addi $t6, $t6, 1           # aumentar en 1
                SET_TABLERO_i_j($t0,$t1,$t6)
                j case_8
            case_8:                        # caso 8: i+1; j+1
                addi $t0, $t8, 1                
                addi $t1, $t9, 1                
                bgtu $t1, $t5, branch        # si es mayor que el numero maximo de la columna
                bgtu $t0, $t5, branch      # si es mayor que el numero maximo de la columna
                GET_TABLERO_i_j($t0,$t1,$t6)
                beq $t6, -1, branch
                addi $t6, $t6, 1           # aumentar en 1
                SET_TABLERO_i_j($t0,$t1,$t6)
                j branch
            branch:
                bne $t9, $t5, for2
        addi $t8, $t8, 1
        bne $t8, $t5, for1
.end_macro


