.macro PRINT_matriz(%X)
    move $t5, %X
    addi $t8, $zero, 0
    for1:
        addi $t9, $zero, 0
        for2:
            GET_TABLERO_i_j($t8,$t9,$a0)
            PRINT_int_register($a0)
            PRINT_string_asciiz(espacio)
            addi $t9, $t9, 1
            blt $t9, $t5, for2
        addi $t8, $t8, 1
        PRINT_string_asciiz(salto_linea)
        bne $t8, $t5, for1
.end_macro


#######################  
#   RESTO DIG1 DIG2   #
#######################

.macro modulo_digito1(%reg)
    div $t0, %reg, 10
    mul $t0, $t0, -1	# - parte entera
    mul $t0, $t0, 10
    add $t0, %reg, $t0	# reg1 - parte_entera*reg2 = resto
.end_macro

.macro modulo_digito2(%reg)
    div $t0, %reg, 100
    mul $t0, $t0, -1	# - parte entera
    mul $t0, $t0, 10	
    add $t0, %reg, $t0	# reg1 - parte_entera*reg2 = resto
    div $t0, $t0, 10
.end_macro

.macro mostrar_digito_1_mina(%digito)
    la $a0, %digito  # la direccion del rombo
    la $a1, display     # la direcion del display
    addi $t2, $zero, 1
    addi $t9, $zero, 0 #columna
    addi $t0, $zero, 968 #fila
    jal MOSTRAR3
.end_macro

.macro mostrar_digito_2_mina(%digito)
    la $a0, %digito  # la direccion del rombo
    la $a1, display     # la direcion del display
    addi $t2, $zero, 1
    addi $t9, $zero, 0 #columna
    addi $t0, $zero, 1012 #fila
