.end_macro
    
    
#######################  
# BUSCA VACIOS CERCA  #
#######################

.macro buscar_vacios(%X,%Y)
    move $t8, %X
    move $t9, %Y
    sw $t8, i
    sw $t9, j
    GET_TABLERO_i_j($t8,$t9,$t6)
    bne $t6, 0, fin_buscar
        
    case_1_buscar:                        # caso 1: i-1; j-1  # $t0 aux_i, $t1 aux_j
        lw $t8, i
        lw $t9, j
        addi $t0, $t8, -1                
        addi $t1, $t9, -1                
        bltu $t0, 0, case_4_buscar        # si es menor que 0 no sirve
        bltu $t1, 0, case_2_buscar        # si es menor que 0 no sirve
        GET_TABLERO_i_j($t0,$t1,$t6)
        jal buscar
        j case_2_buscar
     
    case_2_buscar:                        # caso 2: i-1; j
        lw $t8, i
        lw $t9, j
        addi $t0, $t8, -1                
        addi $t1, $t9, 0                
        bltu $t0, 0, case_4_buscar        # si es menor que 0 no sirve
        GET_TABLERO_i_j($t0,$t1,$t6)
        jal buscar
        j case_3_buscar
            
    case_3_buscar:                        # caso 3: i-1; j+1
        lw $t8, i
        lw $t9, j
        lw $t5, cant_casillas
        addi $t0, $t8, -1                
        addi $t1, $t9, 1                
        bltu $t0, 0, case_4_buscar        # si es menor que 0 no sirve
        bgtu $t1, $t5, case_4_buscar      # si es mayor que el numero maximo de la columna
        GET_TABLERO_i_j($t0,$t1,$t6)
        jal buscar
        j case_4_buscar
            
    case_4_buscar:                        # caso 4:   i; j-1     
        lw $t8, i
        lw $t9, j
        addi $t0, $t8, 0          
        addi $t1, $t9, -1                
        bltu $t1, 0, case_5_buscar        # si es menor que 0 no sirve
        GET_TABLERO_i_j($t0,$t1,$t6)
        jal buscar
        j case_5_buscar
        
    case_5_buscar:                         # caso 5:   i; j
        lw $t8, i
        lw $t9, j
        addi $t0, $t8, 0          
        addi $t1, $t9, 0                
        GET_TABLERO_i_j($t0,$t1,$t6)
        jal buscar
        j case_5_buscar
                
    case_6_buscar:                        # caso 6:   i; j+1
        lw $t8, i
        lw $t9, j
        lw $t5, cant_casillas
        addi $t0, $t8, 0 
        addi $t1, $t9, 1                
        bgtu $t1, $t5, case_7_buscar      # si es mayor que el numero maximo de la columna
        GET_TABLERO_i_j($t0,$t1,$t6)
        jal buscar
        j case_7_buscar
                
    case_7_buscar:                        # caso 7: i+1; j-1
        lw $t8, i
        lw $t9, j
        lw $t5, cant_casillas
        addi $t0, $t8, 1                
        addi $t1, $t9, -1                
        bltu $t1, 0, case_7_buscar        # si es menor que 0 no sirve
        bgtu $t0, $t5, fin_buscar      # si es mayor que el numero maximo de la columna
        GET_TABLERO_i_j($t0,$t1,$t6)
        jal buscar
        j case_7_buscar
                
    case_8_buscar:                        # caso 8: i+1; j
        lw $t8, i
        lw $t9, j
        lw $t5, cant_casillas
        addi $t0, $t8, 1                
        addi $t1, $t9, 0                
        bgtu $t0, $t5, fin_buscar      # si es mayor que el numero maximo de la columna
        GET_TABLERO_i_j($t0,$t1,$t6)
        jal buscar
        j case_9_buscar
            
    case_9_buscar:                        # caso 9: i+1; j+1
        lw $t8, i
        lw $t9, j
        lw $t5, cant_casillas
        addi $t0, $t8, 1                
        addi $t1, $t9, 1                
        bgtu $t1, $t5, fin_buscar        # si es mayor que el numero maximo de la columna
        bgtu $t0, $t5, fin_buscar      # si es mayor que el numero maximo de la columna
        GET_TABLERO_i_j($t0,$t1,$t6)
        jal buscar
        j fin_buscar
        
    buscar:
        beq $t6, 0, mostrar_0_buscar
        beq $t6, 1, mostrar_1_buscar
        beq $t6, 2, mostrar_2_buscar
        beq $t6, 3, mostrar_3_buscar
        beq $t6, 4, mostrar_4_buscar
        beq $t6, -1, fin_buscar
            
        seguir_buscando:
            jr $ra
            
    mostrar_0_buscar:
        la $a0, vacio  # la direccion del rombo
        la $a1, display     # la direcion del display
        add $t8, $zero, $zero  #Reinicializar t8
        addi $t2, $zero, 1
        add $t9, $zero, $t1 #columna
        mul $t9, $t9, 26624
        addi $t9, $t9, 79872
        mul $t0, $t0, 52  #fila
        addi $t0, $t0, 52
        jal MOSTRAR3
        j seguir_buscando
        
    mostrar_1_buscar:
        la $a0, cuadro_1  # la direccion del rombo
        la $a1, display     # la direcion del display
        add $t8, $zero, $zero  #Reinicializar t8
        addi $t2, $zero, 1
        add $t9, $zero, $t1 #columna
        mul $t9, $t9, 26624
        addi $t9, $t9, 79872
        mul $t0, $t0, 52  #fila
        addi $t0, $t0, 52
        jal MOSTRAR3
        j seguir_buscando
        
    mostrar_2_buscar:
        la $a0, cuadro_2  # la direccion del rombo
        la $a1, display     # la direcion del display
        add $t8, $zero, $zero  #Reinicializar t8
        addi $t2, $zero, 1
        add $t9, $zero, $t1 #columna
        mul $t9, $t9, 26624
        addi $t9, $t9, 79872
        mul $t0, $t0, 52  #fila
        addi $t0, $t0, 52
        jal MOSTRAR3
        j seguir_buscando
        
    mostrar_3_buscar:
        la $a0, cuadro_3  # la direccion del rombo
        la $a1, display     # la direcion del display
        add $t8, $zero, $zero  #Reinicializar t8
        addi $t2, $zero, 1
        add $t9, $zero, $t1 #columna
        mul $t9, $t9, 26624
        addi $t9, $t9, 79872
        mul $t0, $t0, 52  #fila
        addi $t0, $t0, 52
        jal MOSTRAR3
        j seguir_buscando
        
    mostrar_4_buscar:
        la $a0, cuadro_4  # la direccion del rombo
        la $a1, display     # la direcion del display
        add $t8, $zero, $zero  #Reinicializar t8
        addi $t2, $zero, 1
        add $t9, $zero, $t1 #columna
        mul $t9, $t9, 26624
        addi $t9, $t9, 79872
        mul $t0, $t0, 52  #fila
        addi $t0, $t0, 52
        jal MOSTRAR3
        j seguir_buscando
        
    
    fin_buscar: 
    
.end_macro

